import React, { useState, useEffect } from 'react';
import { Toast } from '../common/Toast';
import DrillItem from './DrillItem';
import ConfirmationModal from '../common/ConfirmationModal';
import { DRILL_FIELDS } from '../../constants/drillFields';
import { fetchDrills, updateDrill, deleteDrillById } from '../../utils/drillOperations';

export function DrillLibrary() {
  const [drills, setDrills] = useState([]);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);
  const [drillToDelete, setDrillToDelete] = useState(null);
  const [editMode, setEditMode] = useState({});
  const [editedDrill, setEditedDrill] = useState({});
  const [showToast, setShowToast] = useState(false);
  const [toastType, setToastType] = useState('success');
  const [successMessage, setSuccessMessage] = useState('');

  useEffect(() => {
    loadDrills();
  }, []);

  const loadDrills = async () => {
    try {
      setLoading(true);
      const data = await fetchDrills();
      setDrills(data || []);
    } catch (err) {
      setError(err.message);
      setToastType('error');
      setShowToast(true);
    } finally {
      setLoading(false);
    }
  };

  const handleStartEdit = (drill) => {
    setEditMode({ ...editMode, [drill.id]: true });
    setEditedDrill({
      ...editedDrill,
      [drill.id]: { ...drill }
    });
  };

  const handleCancelEdit = (drillId) => {
    setEditMode({ ...editMode, [drillId]: false });
    setEditedDrill({
      ...editedDrill,
      [drillId]: undefined
    });
  };

  const handleFieldEdit = async (drillId, field, value) => {
    // Save all fields immediately
    try {
      setLoading(true);
      const updatedData = { [field]: value };
      await updateDrill(drillId, updatedData);

      setDrills(drills.map(drill => 
        drill.id === drillId ? { ...drill, ...updatedData } : drill
      ));

      setSuccessMessage(`${field.charAt(0).toUpperCase() + field.slice(1)} saved successfully`);
      setToastType('success');
      setShowToast(true);
    } catch (err) {
      setError(err.message);
      setToastType('error');
      setShowToast(true);
      throw err; // Propagate error to DrillItem
    } finally {
      setLoading(false);
    }
  };

  const handleSaveEdit = async (drillId) => {
    try {
      setLoading(true);
      const updatedData = editedDrill[drillId];
      await updateDrill(drillId, updatedData);

      setDrills(drills.map(drill => 
        drill.id === drillId ? { ...drill, ...updatedData } : drill
      ));

      handleCancelEdit(drillId);
      setSuccessMessage('Drill updated successfully');
      setToastType('success');
      setShowToast(true);
    } catch (err) {
      setError(err.message);
      setToastType('error');
      setShowToast(true);
    } finally {
      setLoading(false);
    }
  };

  const deleteDrill = (id) => {
    setDrillToDelete(drills.find(drill => drill.id === id));
  };

  const confirmDelete = async () => {
    if (!drillToDelete) return;

    try {
      setLoading(true);
      await deleteDrillById(drillToDelete.id);

      setDrills(drills.filter(drill => drill.id !== drillToDelete.id));
      setDrillToDelete(null);
      setSuccessMessage('Drill deleted successfully');
      setToastType('success');
      setShowToast(true);
    } catch (err) {
      setError(err.message);
      setToastType('error');
      setShowToast(true);
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="container mx-auto px-4 py-8">
      {loading ? (
        <div className="text-center py-8">Loading drills...</div>
      ) : drills.length === 0 ? (
        <div className="text-center py-8 text-gray-400">No drills found. Add some drills to get started.</div>
      ) : (
        <div className="space-y-4">
          {drills.map((drill) => (
            <DrillItem
              key={drill.id}
              drill={drill}
              setDrill={(updatedDrill) => {
                setDrills(drills.map(d => d.id === drill.id ? updatedDrill : d));
              }}
              editMode={editMode}
              editedDrill={editedDrill}
              onStartEdit={handleStartEdit}
              onCancelEdit={handleCancelEdit}
              onSaveEdit={handleSaveEdit}
              onDelete={deleteDrill}
              onFieldEdit={handleFieldEdit}
              fields={DRILL_FIELDS}
            />
          ))}
        </div>
      )}

      {drillToDelete && (
        <ConfirmationModal
          title="Confirm Deletion"
          message="Are you sure you want to delete this drill?"
          onConfirm={confirmDelete}
          onCancel={() => setDrillToDelete(null)}
        />
      )}

      {showToast && (
        <Toast
          message={toastType === 'success' ? successMessage : error}
          type={toastType}
          isVisible={showToast}
          onClose={() => setShowToast(false)}
        />
      )}
      {drillToDelete && (
        <ConfirmationModal
          isOpen={!!drillToDelete}
          title="Delete Drill"
          message={`Are you sure you want to delete "${drillToDelete.name}"? This action cannot be undone.`}
          confirmLabel="Delete"
          onConfirm={confirmDelete}
          onCancel={() => setDrillToDelete(null)}
        />
      )}
    </div>
  );
}
